import React from 'react';

const CartItem = ({ cartItem }) => {
	const { name, price, imageUrl } = cartItem;

	return (
		<div>
			<img alt={name} src={imageUrl} />
			<span>{name}</span>
			<span>{price} $</span>
		</div>
	);
};

export default CartItem;
